import ProfileDetails from "./ProfileDetails";
import { Card, Container } from "react-bootstrap";
import React from "react";
import styled from "styled-components";

const StyledCard = styled(Card)`
  width: 100%;
  margin: 1rem auto;
`;

const Details = styled(StyledCard)``;

// const ServicesCard = styled(StyledCard)`
//   display: grid;
//   width: 100%;
//   margin: 1rem auto;
// `;

const About = styled(StyledCard)``;

const Portfolio = styled(StyledCard)``;

function EditProfile() {
  return (
    <Container>
      <Details className="d-flex align-items-center">
        <ProfileDetails />
      </Details>
      <About>
        <AboutMe />
      </About>
      <ServicesCard>
        <div>
          {Services.map(service => (
            <Service
              key={service.key}
              image={service.image}
              name={service.name}
              count={service.count}
            />
          ))}
        </div>
      </ServicesCard>
      <Portfolio>
        <h1>Portfolio</h1>
      </Portfolio>
    </Container>
  );
}

export default EditProfile;
